=>'Tænd eller sluk for registrering af buspladser','By default Registration is ON but you can keep it off by switching this option'=>'Som standard er registrering TIL, men du kan holde den fra ved at slå denne indstilling til','By default Boarding Time is ON but you can keep it off by switching this option'=>'Som standard er Boarding Time TIL, men du kan deaktivere den ved at aktivere denne indstilling','By default Dropping Time is ON but you can keep it off by switching this option'=>'Som standard er Drop Time TIL, men du kan deaktivere den ved at slå denne indstilling til.','Please select your bus seat type . Default Without Seat Plan'=>'Vælg venligst din bus sædetype. Standard uden sædeplan','Please Type your bus total seat.'=>'Indtast venligst dit samlede antal sæder i bussen.','Select Particular Date or Repeated Date.'=>'Vælg Bestemt dato eller Gentaget dato.','Here you can set bus route for stopage and dropping'=>'Her kan du indstille busruten for stop og afsætning','Please configure bus route price. Before price setting must be complete route configuration .'=>'Konfigurer venligst busrutens pris. Før prisindstillingen skal rutekonfigurationen være fuldført.','Turn On or Off Extra service.'=>'Slå Ekstra tjeneste til eller fra.','Turn On or Off pickup point.'=>'Tænd eller sluk for afhentningspunkt.','Turn On or Off drop-off point.'=>'Slå afleveringssted til eller fra.','To add any new tax class , Please go to WooCommerce ->Settings->Tax Area'=>'For at tilføje en ny skatteklasse skal du gå til WooCommerce -> Indstillinger -> Skatteområde','Please upload images for gallery'=>'Upload venligst billeder til galleriet','<span style="color:yellow">Status</span>'=>'<span style="color:yellow">Status</span>','For Woocommerce Environment Status'=>'For Woocommerce-miljøstatus','WordPress Version : '=>'WordPress-version:','Woocommerce Installed : '=>'Woocommerce installeret:','Woocommerce Version : '=>'Woocommerce-version:','Name : '=>'Navn:','Email Address : '=>'E-mailadre