en "Fuldes". Færdig! God fornøjelse.','Video Tutorial'=>'Videovejledning','Welcome to Documentation of Bus Ticket Booking with Seat Reservation Plugin'=>'Velkommen til dokumentation af busbilletbestilling med sædereservationsplugin','BUY PRO'=>'KØB PRO','How to install the plugin?'=>'Hvordan installerer man plugin\'et?','Please watch the video to know how you can install the plugin.'=>'Se venligst videoen for at finde ud af, hvordan du installerer plugin\'et.','How to add a New Bus?'=>'Hvordan tilføjer man en ny bus?','After install the plugin you can add a new bus. Please watch the video to know how you can do it:'=>'Efter installation af plugin\'et kan du tilføje en ny bus. Se videoen for at finde ud af, hvordan du gør det:','How to book a bus ticket?'=>'Hvordan bestiller man en busbillet?','In this video you can know how easy to place a order to book a bus ticket:'=>'I denne video kan du se, hvor nemt det er at bestille en busbillet:','How to setup PDF ticket?'=>'Hvordan opretter man en PDF-billet?','Please watch the video to know how to setup PDF ticket.'=>'Se videoen for at finde ud af, hvordan du opretter en PDF-billet.','How to setup email?'=>'Hvordan opsætter man e-mail?','Please watch the video to know how to setup Email.'=>'Se videoen for at finde ud af, hvordan du opsætter e-mail.','How to set bus on ticket price?'=>'Hvordan sætter man prisen på en busbillet?','Please watch this video to know how to set bus on ticket price.'=>'Se denne video for at finde ud af, hvordan du fastsætter prisen på en busbillet.','How to set bus on specific day?'=>'Hvordan indstiller man en bus på en bestemt dag?','Please watch this video to know how to set bus on specific day.'=>'Se denne video for at finde ud af, hvordan du indstiller bussen på en bestemt dag.','How to set bus booking buffer time?'=>'Hvordan indstiller man buffertid for busbooking?','Please watch this video to know how to set bus booking on buffer time.'=>'Se denne video for at finde ud af, hvordan du indstiller busbooking til buffertid.','How to get ticket from admin panel?'=>'Hvordan får man en billet fra administratorpanelet?','Please watch this video to know how to get ticket from admin panel.'=>'Se venligst denne video for at finde ud af, hvordan du får en billet fra administrationspanelet.','How to export passenger list in CSV?'=>'Hvordan eksporterer man en passagerliste i CSV-format?','Please watch this video to know how to export passenger list in CSV.'=>'Se denne video for at få at vide, hvordan du eksporterer en passagerliste til CSV.','How to create two door and four column seat plan?'=>'Hvordan laver man en plan med to døre og fire søjler til sæderne?','Please watch this video to know how to create two door and four column seat plan.'=>'Se denne video for at finde ud af, hvordan du laver en plan med to døre og fire søjler til sæderne.','How to create three column seat plan?'=>'Hvordan laver man en plan med tre sæder?','Please watch this video to know how to create three column seat plan.'=>'Se denne video for at finde ud af, hvordan man laver en plan med tre sæder.','How to booking bus?'=>'Hvordan bestiller man bussen?','Please watch this video to know how to booking bus.'=>'Se venligst denne video for at finde ud af, hvordan du bestiller bussen.','How to buy PRO version?'=>'Hvordan køber man PRO-versionen?','Bus Ticket Booking with Seat Reservation PRO'=>'Busbilletbestilling med sædereservation PRO','Shortcodes included with Bus Ticket Booking with Seat Reservation Plugin:'=>'Kortkoder inkluderet i busbilletbestilling med sædereservationsplugin:','Shortcode'=>'Kortkode','Parameter'=>'Parameter','Description'=>'Beskrivelse','cat'=>'kat','By default showing all bus, but if you want to show bus list of a particular category you can use this attribute, just put the category id with this. Example:'=>'Som standard vises alle busser, men hvis du vil vise en busliste for en bestemt kategori, kan du bruge denne attribut, blot ved at indsætte kategori-id\'et sammen med dette. Eksempel:','show'=>'vise','By default showing 20 bus per page. If you want to change it and set limit input the limit number. example:'=>'Som standard vises 20 busser pr. side. Hvis du vil ændre det og indstille en grænse, skal du indtaste grænsetallet. Eksempel:','This shortcode will show the Create Ticket form. A user needs to put their ticket pin into the box and hit the enter button then the ticket will appear. Only login users can view this page.'=>'Denne shortcode viser formularen "Opret billet". En bruger skal indtaste sin billet-pinkode i feltet og trykke på Enter-knappen, hvorefter billetten vises. Kun brugere, der er logget ind, kan se denne side.','This shortcode will display the search form like if you want to show a search box into somewhere in the homepage or any page then just put this shortcode there it will print the bus search form.'=>'Denne shortcode viser søgeformularen, ligesom hvis du vil vise et søgefelt et sted på forsiden eller en hvilken som helst side, skal du blot indtaste denne shortcode der, så udskrives søgeformularen.','This shortcode will also print a bus search form but it will also show the search result on the same page, below of the search form.'=>'Denne shortcode vil også udskrive en bussøgningsformular, men den vil også vise søgeresultatet på samme side, under søgeformularen.','Ticket'=>'Billet','GTFS Export'=>'GTFS-eksport','Export your bus data to GTFS format for Google Transit and other transit applications.'=>'Eksporter dine busdata til GTFS-format til Google Transit og andre transportapplikationer.','Agency Name'=>'Agenturets navn','The name of your transit agency'=>'Navnet på dit transportfirma','Agency URL'=>'Agenturets URL','Your agency website URL'=>'URL\'en til dit bureaus hjemmeside','Agency Timezone'=>'Agenturets tidszone','Timezone for your bus operations'=>'Tidszone for din busdrift','Export Date Range'=>'Eksportér datointerval','to'=>'til','Date range for schedule export (recommended: 30-90 days)'=>'Dat